17	rheden	105	Wat is Rheden	<p>foo</p><p>&nbsp;</p>	Over Rheden	1
12	about	126	Over watstemtmijnraad.nl	<p>Hier komt tekst en uitleg over wat stemt mijn raad. Local</p>	\N	0
13	search	\N	Hoe werkt dit zoekvenster	<p><span style="font-size: 9pt; color: black; font-family: Arial">In bovenstaand zoekvenster kunt u verschillende criteria selecteren. Zo kunt u zoeken naar voorstellen per maand, het soort voorstel (amendement of wetsvoorstel), op onderwerp of per partij. Het is ook mogelijk om uw zoekopdracht te verfijnen, bijvoorbeeld door te zoeken op “alle voorstellen in de categorie onderwijs van februari 2007”. </span></p>	\N	0
4	home	\N	Wat is Politix.nl?	<p><span style="font-size: 9pt; color: black; font-family: Arial">Politix.nl biedt een overzicht van alle wetsvoorstellen waar de Tweede Kamer over heeft gestemd. Bij elk voorstel is aangegeven of het voorstel aangenomen of afgewezen is en hoe de politieke partijen gestemd hebben. <br /><br /></span><span style="font-size: 9pt; color: black; font-family: Arial">De database gaat terug tot en met januari 2003. In slechts sommige gevallen wordt hoofdelijk gestemd. Volgens de wet dient een parlementslid wel zonder last of ruggespraak te stemmen, maar in de praktijk is de partijdiscipline sterker. Als er hoofdelijk gestemd is, dan zal het stemgedrag per Kamerlid weergegeven worden (vanaf oktober 2008). Daarnaast is op Politix.nl elke politicus gekoppeld aan de website <u><a href="http://www.150volksvertegenwoordigers.nl" target="_blank" title="150volksvertegenwoordigers.nl">www.150volksvertegenwoordigers.nl</a> </u>. Hierdoor kunt u snel en gemakkelijk inzicht krijgen in de achtergrond, doelen en idealen van een politicus. </span></p><p>&#160;</p>	\N	0
1	about	\N	Over Politix.nl	<p><span style="font-size: 9pt; color: black; font-family: Arial">Politix.nl is een onafhankelijk initiatief van Josta de Hoog, Niels de Hoog en <a href="http://www.x-m-l.org" target="_blank" title="X-M-L">X-M-L</a> . </span><span style="font-size: 9pt; color: black; font-family: Arial">Zij waren verbaasd dat het stemgedrag van politieke partijen nergens op internet te vinden was, terwijl de wetten die zij maken het leven van velen beïnvloeden. Naast het vierjaarlijkse campagnegeweld, willen zij graag weten welke concrete keuzes politieke partijen maken. </span><span style="font-size: 9pt; color: black; font-family: Arial"> </span></p><p><span style="font-size: 9pt; color: black; font-family: Arial">Politix.nl bestaat sinds januari 2003. Een vernieuwde versie van Politix.nl is in oktober 2008 gelanceerd. De update van Politix.nl is mogelijk gemaakt door <a href="http://www.publiekezaak.nl" target="_blank" title="De Publieke Zaak">De Publieke Zaak</a> en <a href="http://www.watstemtmijnraad.nl" target="_blank" title="watstemtmijnraad.nl">Watstemtmijnraad.nl</a> (Watstemtmijnraad.nl is een initiatief van het Ministerie van Binnenlandse Zaken en Koninkrijksrelaties). Politix.nl wordt in haar dagelijkse organisatie ondersteund door De Publieke Zaak. </span><span style="font-size: 9pt; color: black; font-family: Arial"> </span><span> <br /><br /><span style="font-size: 9pt; color: black; font-family: Arial"><strong><font face="Verdana"><br />Bronnen</font></strong><br /></span><br /></span><span style="font-size: 9pt; color: black; font-family: Arial">De voorstellen die op deze website worden opgenomen zijn wetsvoorstellen en amendementen. Een wetsvoorstel is een voorstel voor een hele wet, vaak ingediend door de regering, maar soms ook door de Tweede Kamer. Een amendement is een voorstel tot een kleine wijziging. Amendementen worden ingediend door de Tweede Kamer. Daarnaast bestaan er ook moties. Dit zijn meningen die door een meerderheid van de Tweede Kamer zijn aangenomen. De regering kan deze mening overnemen, maar ook naast zich neerleggen. Moties worden niet op Politix.nl genoemd. <br /></span><span style="font-size: 9pt; color: black; font-family: Arial"><br />De informatie is gebaseerd op officiële overheidsdocumentatie. </span><span style="font-size: 9pt; font-family: Arial">Alle informatie komt uit Parlando<a href="http://parlando.sdu.nl/"><span style="color: windowtext; text-decoration: none; text-underline: none">.</span></a> In deze database zijn alle parlementaire stukken vanaf 1995 opgenomen. Met het dossiernummer en kamerstuknummer van een voorstel, kun je in Parlando het originele kamerstuk terugvinden. <span style="color: black">Uit ingewikkelde en uitgebreide wetsvoorstellen worden de belangrijkste punten gehaald. </span></span><span style="font-size: 9pt; color: black; font-family: Arial"> </span><span style="font-size: 9pt; color: black; font-family: Arial">De site is niet bedoeld als wettenboek; het gaat hier om de belangrijkste politieke keuzes die gemaakt zijn. Voorstellen die slechts een kleine, vooral bestuurlijke of zeer wettechnische wijziging van een wet zijn, staan niet op deze site. Zo vind je hier bijvoorbeeld geen voorstel om het zinsdeel 'inhoudelijke kaders' te vervangen door 'na te streven inhoudelijke doelstellingen'.<br /><br />Wij doen ons best alle voorstellen zo zorgvuldig en juist mogelijk weer te geven. Ontbreekt er iets of staat er iets verkeerd? Stuur dan een email naar <a href="mailto:info@publiekezaak.nl">info@publiekezaak.nl</a></span><span style="font-size: 9pt; color: black; font-family: Arial">, dan herstellen wij het zo snel mogelijk. </span><span> <br /><br /><strong><br />De Publieke Zaak</strong></span><span style="font-size: 9pt; color: black; font-family: Arial"> <br /><br /><a href="http://www.publiekezaak.nl" target="_blank" title="De Publieke Zaak">De <strong><span style="font-weight: normal; font-family: Arial">Publieke Zaak</span></strong></a> is een vereniging die zich inzet voor fundamentele <em><span style="font-style: normal; font-family: Arial">maatschappelijke </span></em>en<em> </em><em><span style="font-style: normal; font-family: Arial">politiek-bestuurlijke vernieuwing</span></em><em>.</em> De Publieke Zaak is een initiatief van burgers die actief aan de slag willen met de samenleving van morgen en staat los van overheid en politieke organisaties.<em> </em>Politix.nl valt net als <a href="http://www.150vv.nl" target="_blank" title="150volksvertegenwoordigers.nl">150volksvertegenwoordigers.nl</a>, <a href="http://www.maildepolitiek.nl" target="_blank" title="maildepolitiek.nl">maildepolitiek.nl</a> en <a href="http://www.burgerbuddy.nl" target="_blank" title="burgrbuddy.nl">burgerbuddy.nl</a> </span><span style="font-size: 9pt; font-family: Arial"><span style="color: black">onder de paraplu van De Publieke Zaak. Door de koppeling van bovenstaande websites in combinatie met het Burgerbuddy project, wordt ingezet op een meer transparante Tweede Kamer voor de burger. </span></span><span style="font-size: 9pt; color: black; font-family: Arial"> <br /><br /></span><strong><span style="font-size: 9pt; color: black; font-family: Arial">Contact<br /></span></strong><span style="font-size: 9pt; color: black; font-family: Arial"><a href="mailto:info@publiekezaak.nl">info@publiekezaak.nl</a><br /></span><span style="font-size: 9pt; color: black; font-family: Arial">020-5684179</span><span style="color: black; font-family: Arial"><font size="3"> </font></span></p><p>&#160;</p>	\N	0
