17561	2	Eisen aan indiener burgerinitiatief	2006-02-05 00:00:00	Om een burgerinitiatief in te kunnen dienen in Nederland moet men kiesgerechtigd zijn in Nederland (minimaal 18 jaar en in het bezit van de Nederlandse nationaliteit) in plaats van minimaal 16 jaar en inwoner van Nederland.	I8W30140K10	1	1	3	\N	1	2
