17567	2	Gelijkstelling overheidswerknemers en overig werknemers voor reintegratietraject	2006-02-12 00:00:00	Gelijkstelling overheidswerknemer: ook een ambtenaar heeft bij dreigend ontslag recht op een reïntegratietraject. Bovendien kan hij dan, wanneer hij ontslagen is, drie maanden onbetaald werk doen met behoud van uitkering om ervaring op te doen. 	I14W30370K13	1	1	3	\N	1	2
17568	2	Ondersteuning ondernemers door UWV	2006-02-12 00:00:00	De uitvoeringsorganisatie van de werkloosheidswet (het UWV) kan mensen met een WW-uitkering een premie geven bij het vinden van een baan of een startkapitaal verstrekken voor een eigen bedrijf. Ook kan de uitvoeringsinstantie werkgevers die een werkloze in dienst nemen een subsidie voor een gedeelte van het loon geven. 	I15W30370K19	1	2	3	\N	1	2
