19342	2	Wijziging van de Wet gebruik burgerservicenummer	2009-02-19 00:00:00	<p>In dit wetsvoorstel worden kaders aangegeven voor het landelijk elektronisch patiëntendossier (EPD) voor zorgaanbieders. Het EPD is niet één landelijk dossier, maar een stelsel voor het uitwisselen van gegevens. Volgens dat stelsel worden bepaalde medische gegevens van een patiënt overzichtelijk geordend en bewaard door een zorgaanbieder, zodat ze opgevraagd kunnen worden door een andere zorgaanbieder. Een andere zorgaanbieder van die patiënt kan de relevante gegevens, eventueel na daarop geattendeerd te zijn, opvragen, raadplegen en eventueel bewaren. Het wetsvoorstel regelt de kaders voor het EPD: het beschrijft hoe de informatie-uitwisseling verloopt, het regelt de benodigde infrastructuur en het bepaalt de condities voor deze informatie-uitwisseling, zoals de zeggenschap van de patiënt en de voorwaarde dat de medische informatie afdoende beveiligd is.</p>	31466	1	1	19	\N	1	2
19343	2	Implementatie van Europese regelgeving	2009-03-10 00:00:00	<p>Dit wetsvoorstel betreft de Europese dienstenrichtlijn.  Nederland moet deze richtlijn net als de andere lidstaten binnen drie jaar geïmplementeerd hebben. Dit wetsvoorstel maakt deel uit van de wettelijke maatregelen die genomen worden om deze richtlijn te implementeren. Het doel is het verbeteren van de Europese interne dienstenmarkt, door de belemmeringen voor het vrije verkeer van diensten en de vrije vestiging van dienstaanbieders weg te nemen. Daardoor kan de economie verder groeien. </p>	31579	1	1	19	\N	1	2
19344	2	Wijziging van de Werkloosheidswet	2009-03-10 00:00:00	<p>Dit wetsvoorstel neemt belemmeringen weg voor werkhervatting aan de kant van werkgevers die werk aanbieden en versterkt de activerende werking van de WW. In de eerste plaats draagt het voorstel het UWV op ervoor te zorgen dat werkgevers vacatures beschikbaar stellen voor langdurig werkloze WW-gerechtigden, het zogenoemde werkaanbod. De beschikbare banen worden in overleg met de werkgever aangeboden aan langdurig werklozen die naar arbeid bemiddelbaar zijn, maar er niet zelf in zijn geslaagd vervangend werk te vinden. In de tweede plaats wijzigt dit wetsvoorstel de gevolgen van werkhervatting voor het recht op WW van personen die langer dan 52 weken werkloos zijn. Bij werkhervatting zal hun recht op WW niet langer worden beëindigd naar rato van het aantal arbeidsuren. In plaats daarvan worden de inkomsten uit de nieuwe arbeid verrekend met hun WW-uitkering. </p>	31767	1	1	19	\N	1	2
