19346	2	Wet bestuurlijke lus Awb	2009-03-10 00:00:00	<p>Dit wetsvoorstel is een aanvulling op de Algemene wet bestuursrecht met een regeling. De bestuursrechter krijgt de mogelijkheid om hangende een beroepsprocedure het bestuursorgaan de gelegenheid te geven om gebreken in een bestreden besluit te herstellen, in plaats van dit besluit meteen te vernietigen. Dit staat bekend als de 'bestuurlijke lus'. De aanleiding tot dit wetsvoorstel is de praktijk van de uitvoering van grote en kleine besluiten om te bouwen, om de mobiliteit te vergroten of om de leefkwaliteit te verbeteren. Wanneer een besluit door de bestuursrechter vernietigd wordt, moet de procedure om opnieuw tot een besluit te komen van voren af aan gestart worden, wat tot veel vertraging en kosten leidt.</p>	31352	1	1	19	\N	1	2
19347	2	Wijziging Mededingingswet	2009-03-10 00:00:00	<p>Dit wetsvoorstel strekt ertoe de uitzondering op het verbod om mededingingsafspraken te maken ruimer te formuleren. De zogenaamde bagatelregeling in de Mededingingswet wordt gewijzigd. Het hoofddoel van de wijziging is om de positie van leveranciers met een beperkt marktaandeel te versterken. Voorgesteld wordt om in de bagatelregeling het maximale toegestane gezamenlijke marktaandeel van de betrokken ondernemingen te verhogen van 5% naar 10% en de voorwaarde met betrekking tot de maximale gezamenlijke omzet te schrappen. </p>	31531	1	1	19	\N	1	2
