19349	2	Wijziging van de Wet studiefinanciering 2000 en de Wet op het hoger onderwijs en wetenschappelijk onderzoek	2009-03-24 00:00:00	<p>In dit wetsvoorstel zijn de veranderingen in het collegegeld en de studiefinanciering uitgewerkt. Deze veranderingen zijn eerder aangekondigd in de strategische agenda voor het hoger onderwijs-, onderzoek- en wetenschapsbeleid en hun financiële beslag hebben gekregen in de Rijksbegroting. Daarnaast worden enkele andere kleine aanpassingen voorgesteld. Het wettelijk collegegeld wordt geleidelijk verhoogd met tien stappen van 22 euro per jaar. Daartegenover staan aanpassingen in de Wet studiefinanciering 2000 (WSF 2000).  De aanvullende beurs wordt eveneens met tien stappen van 22 euro per jaar verhoogd en de terugbetalingsvoorwaarden bij studieleningen worden vereenvoudigd en versoepeld. Hiermee blijft de financiële toegankelijkheid van het hoger onderwijs gewaarborgd. </p>	31790	1	1	19	\N	1	2
19350	2	Wijziging van de Wet hygiëne en veiligheid badinrichtingen en zwemgelegenheden en de Wet op de waterhuishouding	2009-03-24 00:00:00	<p>Het doel van dit wetsvoorstel is de implementatie van nieuwe richtlijnen over het beheer van de zwemwaterkwaliteit en tot intrekking van oude richtlijnen in de Nederlandse regelgeving. Het wetsvoorstel betreft wijziging van de Wet hygiëne en veiligheid badinrichtingen en zwemgelegenheden (Whvbz) en de Wet op de waterhuishouding (Wwh). Het voorstel biedt de grondslag voor algemene maatregelen van bestuur en ministeriële regelingen ter implementatie van de in de richtlijn voorziene verplichtingen zoals de kwaliteitseisen waaraan het zwemwater moet voldoen en vereisten betreffende het monitoren en het doen van onderzoek. </p>	31527	1	1	19	\N	1	2
19351	2	Wijziging van de Mediawet	2009-03-26 00:00:00	<p>Dit voorstel betreft de landelijke publieke omroep. Met het wetsvoorstel wil de regering de eigenheid van de Nederlandse publieke omroep voor langere tijd erkennen en beschermen. Een grootscheepse hervorming is niet nodig en niet wenselijk. Wel bevat het wetsvoorstel enkele kleinere, gerichte wijzigingen. Het accent van het wetsvoorstel ligt op de regels voor toelating, erkenning, financiering en uittreding van afzonderlijke omroepen. De belangrijkste aanpassingen zijn de volgende: <br />- het ledental blijft bepalend voor het vaste budget van omroepverenigingen, maar de A- en B-statussen maken plaats voor een glijdende schaal; <br />- omroepen verwerven, afhankelijk van hun programmatische bijdrage, een variabel aandeel in het programmaversterkingsbudget. Dit budget, beheerd door de raad van bestuur van de publieke omroep krijgt een multimediale bestemming en wordt verhoogd met geld dat nu geoormerkt is voor neventaken; <br />- nieuwe omroepen gaan zich meer bewijzen en ook regelt het wetsvoorstel de uittreding van omroepen; <br />- voor alle omroepen gelden zoveel mogelijk de principes van goed bestuur voor publieke organisaties. Het radio- en televisiedeel van de NOS wordt losgemaakt van de raad van bestuur. </p>	31804	1	1	19	\N	1	2
