19371	2	Vrijstelling parkeerbelasting	2009-06-09 00:00:00	<p>Mensen die niet in staat zijn zelfstandig 100 meter aan een stuk te voet te overbruggen komen in aanmerking voor een Europese gehandicaptenparkeerkaart. De gemeenten in Nederland voeren echter een verschillend beleid waar het gaat om het parkeren door gehandicapten. In sommige gemeenten hoeft niet betaald te worden, in andere gemeenten moet men met een gehandicaptenparkeerkaart overal, ook op officiële invalidenparkeerplaatsen, betalen. In dit wetsvoorstel wordt ervoor gekozen om gebruikers van een gehandicaptenparkeerkaart vrij te stellen van parkeerbelasting. In parkeergarages en op particuliere parkeerplaatsen geldt echter het voor iedereen gangbare tarief.</p>	30879	1	1	19	\N	1	2
