19378	2	Audiovisuele mediadiensten	2009-06-30 00:00:00	<p>Dit wetsvoorstel strekt tot implementatie van de richtlijn Audiovisuele mediadiensten. Dit is een wijziging van de 'Televisierichtlijn' uit 1989. De voornaamste wijziging is de uitbreiding van de reikwijdte van de richtlijn naar zogenoemde niet-lineaire audiovisuele mediadiensten. Lineaire mediadiensten worden uitgezonden op basis van een door de dienstenaanbieder opgesteld schema. De consument kan hierbij geen invloed uitoefenen op aanvangstijdstip en volgorde van de uitzending. Niet-lineaire diensten zijn diensten op aanvraag. De AVMD-richtlijn hanteert twee regimes: <br />- uitgebreide bepalingen voor lineaire audiovisuele mediadiensten; <br />- basisregels voor audiovisuele mediadiensten op aanvraag. </p>	31876	1	1	19	\N	1	2
19380	2	Betalingsdiensten interne markt	2009-06-30 00:00:00	<p>Dit wetsvoorstel dient ter implementatie van de Europese Richtlijn nr. 2007/64/EG betreffende betalingsdiensten in de interne markt. Deze richtlijn voorziet in de harmonisering van de markt voor betaaldiensten. Deze harmonisatie is tweeledig. Ten eerste wordt de markttoegang voor betaaldienstverleners geregeld door middel van de introductie van een vergunning. Ten tweede worden regels gesteld die betrekking hebben op de relatie tussen de betaaldienstverlener en de consument.</p>	31892	1	1	19	\N	1	2
19382	2	Deelgeschilprocedure letsel- en overlijdensschade	2009-06-30 00:00:00	<p>De afhandeling van letsel- en overlijdensschadeclaims kan lang duren. Soms is er bij dit soort situaties sprake van een geschil met nog eens diverse deelgeschillen. Fixatie op een of meer deelgeschillen kan ertoe leiden dat partijen de kern van de zaak uit het oog verliezen, waardoor de verhoudingen verslechteren en de duur van de afhandeling toeneemt. Een eenvoudige en snelle toegang tot de rechter om tot de oplossing van deze deelgeschillen te komen in de buitengerechtelijke onderhandelingsfase, kan de totstandkoming van een minnelijke regeling bij letsel- en overlijdensschade bevorderen. Dit wetsvoorstel biedt een nieuwe procesvorm: de deelgeschilprocedure. De deelgeschilprocedure biedt zowel de persoon die schade lijdt door dood of letsel, als degene die daarvoor aansprakelijk wordt gehouden, de mogelijkheid in de buitengerechtelijke onderhandelingsfase de rechter te aan te spreken.</p>	31518	1	1	19	\N	1	2
