19397	2	Dwangsom en beroep	2009-09-29 00:00:00	<p>Het wetsvoorstel voorziet in verlenging van beslistermijnen in enkele bijzondere wetten op het terrein van verscheidene ministeries. Uit een inventarisatie is gebleken dat deze termijnen in de praktijk te krap zijn.</p>	31844	1	1	19	\N	1	2
19398	2	Btw-pakket	2009-09-29 00:00:00	<p>Het wetsvoorstel strekt ertoe de richtlijnen BTW-pakket te implementeren in de Wet op de omzetbelasting 1968. De wijziging van de wet betreffen: </p><ul><li>nieuwe regels plaats van dienst: </li><li>nieuwe regels teruggaaf aan ondernemers van in een andere lidstaat betaalde btw: </li><li>nieuwe regels listingsverplichting.</li></ul>	31907	1	1	19	\N	1	2
19396	2	Inlenersaansprakelijkheid	2009-09-17 00:00:00	<p>Om fraude en illegaliteit te bestrijden en werknemers (uitzendkrachten) beter te beschermen worden een aantal maatregelen genomen: </p><ul><li>de inlener en het uitzendbureau worden hoofdelijk aansprakelijk gesteld voor de voldoening van het toepasselijke minimumloon en de toepasselijke minimumvakantiebijslag van de werknemer (de ingeleende persoon); </li><li>de inlener is echter niet hoofdelijke aansprakelijkheid als hij inleent bij een gecertificeerd uitzendbureau.</li></ul>	31833	1	1	19	\N	1	2
19395	2	Oprichting Dienst Uitvoering Onderwijs	2009-09-17 00:00:00	<p>Het Ministerie van Onderwijs, Cultuur en Wetenschap (OCW) heeft twee uitvoeringsorganisaties voor het onderwijs: Centrale Financiën Instellingen (CFI) en de Informatie Beheer Groep (IB-Groep). Deze organisaties houden zich allebei bezig met het verwerken van gegevens van onderwijsinstellingen- en deelnemers. CFI en IB-Groep hebben elk een eigen uitvoeringsproces, terwijl die twee processen in feite bij elkaar horen. Gevolg hiervan is dat er sprake is van versnippering van de informatiehuishouding. Om dit te verbeteren, is een samenvoeging van deze organisaties een oplossing. Dat gebeurt met dit wetsvoorstel.</p>	31944	1	1	19	\N	1	2
19394	2	Wijziging onderwijs	2009-09-17 00:00:00	<p>Doel van dit wetsvoorstel het vergroten van de mogelijkheden van de overheid om te kunnen optreden als er sprake is van: <br />- een ernstige of langdurig tekortschietende onderwijskwaliteit op een school; <br />- bestuurlijk wanbeheer van één of meer scholen; <br />- of een combinatie van beide.</p>	31828	1	1	19	\N	1	2
19393	2	Wijzigingen Mijnbouwwet	2009-09-08 00:00:00	<p>Dit wetsvoorstel beschrijft bevordering van een actieve benutting van vergunningen voor gebruik van de Nederlandse ondergrond voor de opsporing en winning van delfstoffen (met name aardgas) en de ondergrondse opslag van stoffen (met name aardgas en CO2). Een maximale productie van de nog aanwezige gasreserves is van belang voor de voorzieningszekerheid en de inkomsten voor de staat uit de gaswinning. </p>	31479	1	1	19	\N	1	2
19386	2	Algemene Kinderbijslagwet	2009-07-02 00:00:00	<p>Met de Wet van 24 mei 2007 tot wijziging van de Leerplichtwet 1969 en de Wet inburgering in verband met onder meer de invoering van een kwalificatieplicht (Stb. 203) is via een verplichting tot inschrijving bij scholen en opleidingen voorgeschreven dat jongeren tot 18 jaar een startkwalificatie halen en daarmee kwalificatieplichtig worden. Deze invoering van een kwalificatieplicht geldt met ingang van 1 augustus 2007. In dit wetsvoorstel worden voorstellen gedaan voor vervanging van enkele bepalingen uit de Algemene Kinderbijslagwet (AKW) door bepalingen die beter aansluiten bij de kwalificatieplicht. Voornaamste doel hiervan is samenhang aan te brengen in het beleid ter bestrijding van schooluitval en ter bevordering van het behalen van een startkwalificatie.</p>	31890	1	1	19	\N	1	2
19388	2	Kinderbijslagbedragen	2009-07-02 00:00:00	<p>De kinderbijslagbedragen worden jaarlijks op 1 januari en op 1 juli aangepast aan de ontwikkeling van het algemene prijsniveau. Dit gebeurt aan de hand van de consumentenprijsindex. In verband met de economische situatie heeft het kabinet besloten af te zien van de indexering per 1 juli 2009. Het niet-indexeren per 1 juli 2009 wordt met dit wetsvoorstel geregeld.</p>	31966	1	1	19	\N	1	2
19389	2	Verwijsindex risico's jeugdigen	2009-07-02 00:00:00	<p>Met deze wijziging van de Wet op de jeugdzorg wordt een verwijsindex geïntroduceerd waarin jeugdigen kunnen worden gemeld die bepaalde risico's lopen (verwijsindex risico's jeugdigen). Met deze landelijke verwijsindex wordt een betere samenwerking tussen de instanties en professionals in de jeugdketen nagestreefd. </p>	31855	1	1	19	\N	1	2
19390	2	Herindeling Rotterdam en Rozenburg	2009-07-02 00:00:00	<p>De op te heffen gemeente Rozenburg wordt door middel van een grenswijziging toegevoegd aan de gemeente Rotterdam. De herindelingsdatum is voorzien op 18 maart 2010.</p>	31916	1	1	19	\N	1	2
19391	2	Algemene bepalingen omgevingsrecht	2009-07-02 00:00:00	<p>In dit wetsvoorstel zijn wijzigingen van de Wet algemene bepalingen (Wabo) opgenomen die ervoor zorgen dat de tekst van de wet op het moment van inwerkingtreding volledig en actueel is. Het gaat daarbij onder meer om aanpassingen in verband met andere in voorbereiding zijnde of in werking getreden wet- en regelgeving, zoals de Waterwet, het voorstel voor de Dienstenwet ter implementatie van de Europese dienstenrichtlijn, de Wet ruimtelijke ordening (Wro), de zgn. Grondexploitatiewet, et cetera.</p>	31953	1	1	19	\N	1	2
19387	2	Fosfaatgebruiksnorm	2009-07-02 00:00:00	<p>Dit wetsvoorstel strekt ertoe de Meststoffenwet in overeenstemming te brengen met de afspraken met de Europese Commissie. Die afspraken zijn voor de periode 2010 tot en met 2013 vastgelegd in het vierde actieprogramma Nitraatrichtlijn. Ingevolge artikel 5 van de Nitraatrichtlijn zijn lidstaten verplicht een actieprogramma op te stellen waarin de benodigde maatregelen ter bereiking van de milieudoelen van die richtlijn zijn opgenomen. Het derde actieprogramma Nitraatrichtlijn heeft betrekking op de jaren 2004 tot en met 2009. Voor de periode van 2006 tot en met 2009 heeft de Europese Commissie bij beschikking nr. 2005/880/EG1 (derogatiebeschikking) ermee ingestemd dat grondgebruikers onder voorwaarden meer stikstof uit dierlijke mest op hun landbouwgronden brengen dan in beginsel op grond van de Nitraatrichtlijn is toegestaan. Deze beschikking loopt gelijktijdig af met het derde actieprogramma. Het vierde actieprogramma noopt op een aantal onderdelen tot aanpassing van de Meststoffenwet. Dit  wetsvoorstel voorziet daarin.</p>	31945	1	1	19	\N	1	2
19384	2	Waterwet	2009-07-02 00:00:00	<p>De Waterwet regelt het beheer en gebruik van watersystemen en dient ter vervanging van in beginsel alle wetten of delen daarvan die betrekking hebben op het waterbeheer. Dit wetsvoorstel regelt de invoering van de Waterwet. Bestaande wetten op het gebied van waterbeheer worden ingetrokken of onderdelen daarvan overgeheveld naar de Waterwet. Verwijzingen daarnaar in andere wetten worden aangepast. Het wetsvoorstel heeft met name een technisch karakter.</p>	31858	1	1	19	\N	1	2
19385	2	Versterking besturing hoger onderwijs	2009-07-02 00:00:00	<p>Met dit wetsvoorstel wordt de Wet op het hoger onderwijs en wetenschappelijk onderzoek ingrijpend gewijzigd. Het doel is om voorwaarden te scheppen om de instellingen voor hoger onderwijs in staat te stellen tot een goed bestuur en een goede positie van studenten, en het bevorderen van onderwijskwaliteit en de internationale positie van het hoger onderwijs. </p>	31821	1	1	19	\N	1	2
19403	2	Stilzwijgende verlenging lidmaatschappen	2009-10-15 00:00:00	<p>Met dit wetsvoorstel wordt een einde gemaakt aan de zeer ongewenste situatie dat abonnementen en lidmaatschappen verlengd worden, terwijl consumenten geen behoefte meer hebben aan deze producten en diensten. Verzekeringen vallen niet onder dit wetsvoorstel. Met dit wetsvoorstel wordt de stilzwijgende verlenging van meer dan drie maanden van overeenkomsten beperkt tot maximaal een jaar. Het gaat om overeenkomsten met betrekking tot het geregeld afleveren van zaken, elektriciteit daaronder begrepen, of tot het geregeld doen van verrichtingen (abonnementen) verboden en de stilzwijgende verlenging van lidmaatschappen.</p>	30520	1	1	19	\N	1	2
19400	2	Diverse wijzigingen Kernenergiewet	2009-10-13 00:00:00	<p>Dit wetsvoorstel neemt een aantal knelpunten in de Kernenergiewet weg. Het gaat daarbij om onder andere de volgende onderwerpen: </p><ul><li>het mogelijk maken om vergunningen voor nieuwe kerncentrales voor ten hoogste veertig jaar te verlenen; </li><li>het mogelijk maken de aanvraag om een vergunning voor het oprichten van een kerncentrale van een verouderd type te weigeren. </li></ul>	30429	1	1	19	\N	1	2
19376	2	Stemmingen bescherming kinderen tegen seksueel misbruik	2009-06-30 00:00:00	<p>Door ontwikkelingen in de techniek en op internet kan kinderpornografie zich eenvoudig over de landsgrenzen verspreiden en kunnen nieuwe vormen van misbruik zich openbaren. Gelet op deze internationale dimensie vereisen het voorkomen en bestrijden van seksuele uitbuiting en seksueel misbruik van kinderen intensieve en effectieve internationale samenwerking. Het op 25 oktober 2007 te Lanzarote tot stand gekomen Verdrag van de Raad van Europa inzake de bescherming van kinderen tegen seksuele uitbuiting en seksueel misbruik (Trb. 2008, 58) is een internationale overeenstemming op dit terrein. Met dit wetsvoorstel wordt goedkeuring van dat verdrag gevraagd.</p>	31808	1	1	19	\N	1	2
19379	2	Verzekering handelsrisico's	2009-06-30 00:00:00	<p>Dit wijzigingsvoorstel strekt ertoe de Kaderwet aan te passen zodat het bestaande herverzekeringsstelsel, waarbij de Staat door een exportkredietverzekeraar verzekerde exportkredietverzekeringen en investeringsgaranties in herverzekering neemt, wordt vervangen door een stelsel waarbij de Staat exportkredietverzekeringen en investeringsgaranties rechtstreeks aan banken en exporteurs afgeeft ('staatspolissen'). Bovendien strekt deze wijziging ertoe de Kaderwet aan te passen aan enkele nieuwe ontwikkelingen. </p>	31382	1	1	19	\N	1	2
19372	2	Invoering van stempas	2009-06-16 00:00:00	<p>Tot nu toe ontving elke stemgerechtigde een oproepingskaart, die ook gebruikt kon worden voor volmachtverlening door overdracht aan een andere kiezer binnen hetzelfde district. Volmachtverlening aan een kiezer die in een ander district is ingeschreven, kon plaatsvinden op schriftelijke aanvraag. Kiezers die momenteel hun stem wilden uitbrengen in een stembureau naar keuze binnen het gebied van het orgaan waarvoor de verkiezing wordt gehouden, moeten daarvoor een kiezerspas aanvragen. Dit systeem verandert met de invoering van het stemmen in een stembureau naar keuze binnen de eigen gemeente. Bij het stemmen in een stembureau naar keuze binnen de eigen gemeente maakt de kiezer gebruik van een oproepingskaart nieuwe stijl, voorzien van echtheidskenmerken.</p>	30569	1	1	19	\N	1	2
19338	2	Wijziging wet op de huurtoeslag	2009-02-10 00:00:00	<p>Met dit wetsvoorstel wordt de Wet op de huurtoeslag veranderd op de volgende punten:- het verschuiven van de jaarlijkse aanpassing van de huurgerelateerde parameters van 1 juli naar 1 januari; <br />- het afschaffen van de aftrekposten op de rekenhuur voor bedrijfsruimte, garage en onderhuur; <br />- het introduceren van een forfaitair bedrag ten aanzien van de subsidiabele servicekosten; <br />- het afschaffen van de passendheidstoets en de verhuisnorm; <br />- het vereenvoudigen van de procedure voor de jaarlijkse indexering van de zogenoemde normhuren.</p>	31446	1	1	19	\N	1	2
