--
-- Name: add_tags_to_vector(integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION add_tags_to_vector(raadsstuk integer) RETURNS void
    LANGUAGE plpgsql
    AS $$declare

t text;

begin

perform set_curcfg('dutch');

t := concat(name || ' ') as name from rs_raadsstukken_tags rt join sys_tags ta on rt.tag = ta.id where rt.raadsstuk = raadsstuk;

update rs_raadsstukken_vectors set vector = vector || setweight(to_tsvector(t), 'C') where id = raadsstuk;

end;$$;


