--
-- Name: create_vector(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION create_vector() RETURNS trigger
    LANGUAGE plpgsql
    AS $$declare

v tsvector;

s text;

t text;

begin

perform set_curcfg('dutch');

s := name from sys_regions where id = NEW.region;

t := concat(name_sortkey || ' ') from pol_politicians p join rs_raadsstukken_submitters rs ON rs.politician = p.id join rs_raadsstukken r on r.id = rs.raadsstuk where r.id = NEW.id;

v := setweight(to_tsvector(NEW.title), 'A') || setweight(to_tsvector(strip_tags(NEW.summary)), 'B') || setweight(to_tsvector(NEW.code), 'A') || setweight(to_tsvector(s), 'A') || setweight(to_tsvector(t), 'C');

IF (TG_OP = 'INSERT') then


ELSEIF (TG_OP = 'UPDATE') then

  UPDATE rs_raadsstukken_vectors set vector = v where id = NEW.id;

END IF;

return null;

end$$;


