CREATE FUNCTION genkey(str character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $$

  BEGIN

    RETURN substring(str FROM '[^a-z'' -].*');

  END

$$;


--
-- Name: get_party(integer, integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION get_party(raadsstuk_id integer, politician_id integer) RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
	party_id INTEGER;
BEGIN
	party_id := party FROM pol_politician_functions f JOIN rs_raadsstukken r ON f.region = r.region
		WHERE f.politician = politician_id AND r.id = raadsstuk_id AND r.vote_date BETWEEN f.time_start AND f.time_end ORDER BY f.id LIMIT 1;
	RETURN party_id;
END;
$$;


--
-- Name: map(character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION map(str character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $$

  DECLARE

    len int;

    i int;

    ch char;

    mappedStr varchar;

  BEGIN

    len := char_length(str);

    mappedStr := '';

    FOR i IN 1..len LOOP

      ch := substring(str FROM i FOR 1);

      mappedStr := mappedStr || COALESCE ((SELECT stripped FROM sys_char_lut WHERE original=ch LIMIT 1),ch);

    END LOOP;

    RETURN mappedStr;

  END

$$;


