CREATE FUNCTION strip_tags(text text) RETURNS text
    LANGUAGE sql
    AS $_$select "replace"("replace"("replace"("replace"("replace"("replace"(regexp_replace($1, '<(.*?)>'::text, ''::text, 'g'::text), '&gt;'::text, '>'::text), '&lt;'::text, '<'::text), '&quot;'::text, '"'::text), '&apos;'::text, ''''::text), '&nbsp;'::text, ' '::text), '&amp;'::text, '&'::text);$_$;


--
-- Name: ts_debug(text); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION ts_debug(text) RETURNS SETOF tsdebug
    LANGUAGE sql STRICT
    AS $_$

select 

        m.ts_name,

        t.alias as tok_type,

        t.descr as description,

        p.token,

        m.dict_name,

        strip(to_tsvector(p.token)) as tsvector

from

        parse( _get_parser_from_curcfg(), $1 ) as p,

        token_type() as t,

        pg_ts_cfgmap as m,

        pg_ts_cfg as c

where

        t.tokid=p.tokid and

        t.alias = m.tok_alias and 

        m.ts_name=c.ts_name and 

        c.oid=show_curcfg() 

$_$;


--
-- Name: update_party_cache(integer, integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION update_party_cache(raadsstuk_id integer, party_id integer) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
	cache RECORD;
BEGIN
    IF (SELECT COUNT(*) FROM rs_raadsstukken WHERE id = raadsstuk_id) = 0 THEN
		RETURN;
	END IF;
	IF (SELECT COUNT(*) FROM rs_party_vote_cache WHERE raadsstuk = raadsstuk_id AND party = party_id) = 0 THEN
	END IF;
	SELECT
		COALESCE(SUM((vote = 0)::int), 0) AS vote_0, COALESCE(SUM((vote = 1)::int), 0) AS vote_1, COALESCE(SUM((vote = 2)::int), 0) AS vote_2, COALESCE(SUM((vote = 3)::int), 0) AS vote_3
		INTO cache FROM rs_votes WHERE raadsstuk = raadsstuk_id AND party = party_id;
	UPDATE rs_party_vote_cache
		SET vote_0 = cache.vote_0, vote_1 = cache.vote_1, vote_2 = cache.vote_2, vote_3 = cache.vote_3
		WHERE raadsstuk = raadsstuk_id AND party = party_id;
END;
$$;


--
-- Name: update_party_vote_cache(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION update_party_vote_cache() RETURNS trigger
    LANGUAGE plpgsql
    AS $$   DECLARE

     party_id INTEGER;

   BEGIN

     IF (TG_OP != 'INSERT') THEN

         party_id := party FROM pol_politician_functions f JOIN rs_raadsstukken r ON f.region = r.region WHERE f.politician=OLD.politician AND r.id = OLD.raadsstuk AND vote_date BETWEEN time_start AND time_end LIMIT 1;

         IF party_id IS NULL THEN

           IF (TG_OP = 'DELETE') THEN

             RETURN OLD;

           ELSE

             RAISE EXCEPTION 'Grote ellende: party_id IS NULL for id: %, %', OLD.id, OLD.raadsstuk;

           END IF;

         END IF;

         EXECUTE 'UPDATE rs_party_vote_cache SET vote_' || OLD.vote || '=vote_' || OLD.vote || '-1 WHERE raadsstuk=' || OLD.raadsstuk || ' AND party=' || party_id || ';';

         EXECUTE 'UPDATE rs_vote_cache SET vote_' || OLD.vote || '=vote_' || OLD.vote || '-1 WHERE id=' || OLD.raadsstuk;

         IF (TG_OP = 'DELETE') THEN

             RETURN OLD;

         END IF;

     END IF;

     party_id := party FROM pol_politician_functions f JOIN rs_raadsstukken r ON f.region = r.region WHERE f.politician=NEW.politician AND r.id = NEW.raadsstuk AND vote_date BETWEEN time_start AND time_end LIMIT 1;

     IF (SELECT COUNT(*) FROM rs_party_vote_cache WHERE raadsstuk=NEW.raadsstuk AND party=party_id) = 0 THEN


     END IF;

     EXECUTE 'UPDATE rs_party_vote_cache SET vote_' || NEW.vote || '=vote_' || NEW.vote || '+1 WHERE raadsstuk=' || NEW.raadsstuk || ' AND party=' || party_id || ';';

     EXECUTE 'UPDATE rs_vote_cache SET vote_' || NEW.vote || '=vote_' || NEW.vote || '+1 WHERE id=' || NEW.raadsstuk;

     RETURN NEW;

   END

$$;


