--
-- Name: update_vote_cache(integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION update_vote_cache(raadsstuk_id integer) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
	cache RECORD;
BEGIN
	SELECT
		COALESCE(SUM((vote = 0)::int), 0) AS vote_0, COALESCE(SUM((vote = 1)::int), 0) AS vote_1, COALESCE(SUM((vote = 2)::int), 0) AS vote_2, COALESCE(SUM((vote = 3)::int), 0) AS vote_3
		INTO cache FROM rs_votes WHERE raadsstuk = raadsstuk_id;
	UPDATE rs_vote_cache
		SET vote_0 = cache.vote_0, vote_1 = cache.vote_1, vote_2 = cache.vote_2, vote_3 = cache.vote_3
		WHERE id = raadsstuk_id;
END;
$$;


